import React from 'react';
import { StyleSheet, View, Button, Text, Image, Dimensions} from 'react-native';
import { useState, useEffect } from 'react';
import emoji from '../JSON/emojiJson.json'
//====================================================================
//====================================================================
const EmojiComp = ({ CallbackFunction, lastEmoji }) => {
    const [currentEmoji, setCurrentEmoji] = useState(lastEmoji);

   
   

    return(
        <View style={styles.container}>

            {CallbackFunction(currentEmoji)}
            
            <Text style={styles.title}>Choose a new emoji</Text>

            <View style={styles.allEmojis}>
                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Grapes);                
                }}>{emoji.foodEmojis.Grapes }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.peach);                
                }}>{emoji.foodEmojis.peach }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Melon);                
                }}>{emoji.foodEmojis.Melon }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Watermelon);                
                }}>{emoji.foodEmojis.Watermelon }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Tangerine);                
                }}>{emoji.foodEmojis.Tangerine }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Lemon);                
                }}>{emoji.foodEmojis.Lemon }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Banana);                
                }}>{emoji.foodEmojis.Banana }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Pineapple);                
                }}>{emoji.foodEmojis.Pineapple }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Mango);                
                }}>{emoji.foodEmojis.Mango }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.RedApple);                
                }}>{emoji.foodEmojis.RedApple }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.GreenApple);                
                }}>{emoji.foodEmojis.GreenApple }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Pear);                
                }}>{emoji.foodEmojis.Pear }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Cherries);                
                }}>{emoji.foodEmojis.Cherries }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Strawberry);                
                }}>{emoji.foodEmojis.Strawberry }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.KiwiFruit);                
                }}>{emoji.foodEmojis.KiwiFruit }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Tomato);                
                }}>{emoji.foodEmojis.Tomato }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Coconut);                
                }}>{emoji.foodEmojis.Coconut }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Avocado);                
                }}>{emoji.foodEmojis.Avocado }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Eggplant);                
                }}>{emoji.foodEmojis.Eggplant }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Potato);                
                }}>{emoji.foodEmojis.Potato }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Carrot);                
                }}>{emoji.foodEmojis.Carrot }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.EarofCorn);                
                }}>{emoji.foodEmojis.EarofCorn }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.HotPepper);                
                }}>{emoji.foodEmojis.HotPepper }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Cucumber);                
                }}>{emoji.foodEmojis.Cucumber }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.LeafyGreen);                
                }}>{emoji.foodEmojis.LeafyGreen }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Broccoli);                
                }}>{emoji.foodEmojis.Broccoli }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Garlic);                
                }}>{emoji.foodEmojis.Garlic }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Onion);                
                }}>{emoji.foodEmojis.Onion }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Mushroom);                
                }}>{emoji.foodEmojis.Mushroom }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Peanuts);                
                }}>{emoji.foodEmojis.Peanuts }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Chestnut);                
                }}>{emoji.foodEmojis.Chestnut }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Bread);                
                }}>{emoji.foodEmojis.Bread }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.Croissant);                
                }}>{emoji.foodEmojis.Croissant }</Text>

                <Text style={styles.emoji} onPress={()=>{
                    setCurrentEmoji(emoji.foodEmojis.BaguetteBread);                
                }}>{emoji.foodEmojis.BaguetteBread }</Text>
            </View>


        </View>
    );
}
const deviceWidth = Math.round(Dimensions.get('window').width);
const deviceHeight = Math.round(Dimensions.get('window').height);

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#FFFFFF',
        width: deviceWidth,
        borderRadius: 15,
        shadowColor: '#0000009D',
        shadowRadius: 30,
        
        //flex: 1,
        //flexWrap: 'wrap',
    },
    title:{
        fontFamily: 'GeneralSans-Semibold',
        fontWeight: 'bold',
        justifyContent: 'çenter',
        alignItems: 'center',
    },
    emoji:{
        fontSize: 20,
        marginHorizontal: 5,
        
    },
    allEmojis:{
    }
});

export default EmojiComp;
